func (c *current) onProgram1(pkg, imps, d any) (any, error) {
	decls := d.([]interface{})
	records := []*ast.RecordDecl{}
	funcs := []*ast.FunctionDecl{}
	for _, item := range decls {
		switch v := item.(type) {
		case *ast.RecordDecl:
			records = append(records, v)
		case *ast.FunctionDecl:
			funcs = append(funcs, v)
		}
	}
	var pkgDecl *ast.PackageDecl
	if pkg != nil {
		pkgDecl = pkg.(*ast.PackageDecl)
	}
	imports := []*ast.ImportDecl{}
	if imps != nil {
		list := imps.([]interface{})
		for _, item := range list {
			imports = append(imports, item.(*ast.ImportDecl))
		}
	}
	return &ast.Program{Package: pkgDecl, Imports: imports, Records: records, Functions: funcs}, nil
}

