func (c *current) onIntLit1(v any) (any, error) {
	var digits []byte
	switch bs := v.(type) {
	case []uint8:
		digits = append(digits, bs...)
	case []interface{}:
		for _, item := range bs {
			switch b := item.(type) {
			case uint8:
				digits = append(digits, b)
			case []uint8:
				digits = append(digits, b...)
			}
		}
	default:
		return nil, fmt.Errorf("unexpected int literal type %T", v)
	}

	var n int64
	for _, b := range digits {
		n = n*10 + int64(b-'0')
	}
	return &ast.IntLiteral{Value: n}, nil
}

